def get_closest(number,to,type):

    if number is None:
        return None

    number_decimal = float(number) / to
    number_rounded = round(number_decimal)
    number_final = int(number_rounded * to)

    if type==1:
        if number_final == CYCLE_IN_SECONDS:
            number_final=0

    if type==2:
        if number_final == MAX_CPU:
            number_final=0

    return number_final

